static void alekhin_parm_pdf(const LHAPDF_FLOAT *fp, double x, double *f)
{
  double uv, dv, g, us, ds, ss;

  uv = lhpdf_x_taylor(x, fp, 1.0, 4, 15,0,1,2);
  dv = lhpdf_x_taylor(x, fp, 1.0, 3, 16,3,4);
  us = lhpdf_x_taylor(x, fp, 1.0, 3, 17,6,9);
  ds = lhpdf_x_taylor(x, fp, 1.0, 3, 18,6,7);
  ss = lhpdf_x_taylor(x, fp, 1.0, 3, 19,6,21);
  g  = lhpdf_x_taylor(x, fp, 2.0, 5, 20,10,11,12,13);
  
 
  f[-6] = f[6] = 0.0;
  f[-5] = f[5] = 0.0;
  f[-4] = f[4] = 0.0;
  f[-3] = f[3] = ss;
  
  f[-2] = us;
  f[-1] = ds;
  f[0] = g;
  f[1] = dv+f[-1];
  f[2] = uv+f[-2]; 
}

